description:
This is the fourth studio album from the Christian pop punk band Stellar Kart.

It contains:

1. &quot;All My Heart&quot;
2. &quot;We Shine&quot; (Fee cover)
3. &quot;Something Holy&quot;
4. &quot;Spirit In the Sky&quot; (Norman Greenbaum cover)
5. &quot;Everything Is Different Now&quot;
6. &quot;It's Not Over&quot;
7. &quot;Rescue&quot;
8. &quot;You Never Let Go&quot; (Matt Redman cover)
9. &quot;Until My Heart Caves In&quot; (Audio Adrenaline cover)
10. &quot;Like the Sun&quot;
